    cargo:{
        type:String,
        enum:['Lector','Inspector','Administrador'],
        default:'Lector',
        require:true,
    },
    imgURL:{
        type:String,
        require:false,
    },
    contrato:{
        type:String,
        require:false,
    },
},{
    timestamps:true
})
export default mongoose.model('Trabajador',lectoSchema);

